import React, { Component } from 'react';
// import Registration from '../../components/Registration';

class Schedule extends Component {

    render() {
        return (
            <section className="kids-schedule py-5">
            <div className="container">
                <div className="row justify-content-center">
                    <div className="col-lg-12">
                    <div className="scheduler border bg-white p-4">
                        <h5>Schedule a Trial Class for Age Group - <span className="childage-text">2 years - 3 years</span></h5>
                        <p>Select a Date</p>
                        <div class="dynamic-dates slick-slide slick-current slick-active" data-slick-index="0" aria-hidden="false" tabindex="0">
                            <input required="" type="radio" id="dateselect1" name="schedule_date" checked="" class="inputdates" value="73" data-val="Mon 21 Dec" data-day="Monday" data-date="21st" data-month="December" tabindex="0"/>
                            <label class="" for="dateselect1">
                                <div class="sdday">Mon</div>
                                <div class="sddate">21</div>
                                <div class="sdmonth">Dec</div>
                            </label>
                        </div>
                    </div>
                    </div>
                </div>
            </div>
            </section>
        )
    }
}

export default Schedule;
